de:
Der Gourmetmittag ist ebenso wie der Gourmetabend, der zu Beginn des Sommers veranstaltet wird, ein Ereignis, das Sie in Prigonrieux nicht verpassen sollten!
Dieses Jahr findet er am Sonntag, dem 10. September, ab 12 Uhr auf dem Platz der Loiseau-Gruppe statt.
Feinschmeckermahlzeit mit Produzentenständen und musikalischer Unterhaltung;

en:
The "midi gourmand", just like the "soirée gourmande" organized at the beginning of the summer, is an event not to be missed in Prigonrieux!
It will take place this year on Sunday, September 10, starting at 12:00 noon, on the Place du Groupe Loiseau.
Gourmet meal with producers' stands and musical entertainment;

